var doc = new jsPDF();
var largePage = 'data:image/jpeg;base64,';
var logo = 'data:image/jpeg;base64,';
var largeWidth = 91;
var largeHeight = 61;
var totalBadges = 0;

// LARGE BADGES
// 9cm x 6cm
// top left anchors:
// x -> 1.25, 10.75
// y -> 2.5, 9, 15.5, 22
var anchorsX = [12.5, 107.5];
var anchorsY = [25, 90, 155, 220];

function insertRow(field1, field2, field3, field4) {
	// allows function overloading
	if(typeof field1 === "undefined") {field1 = ""};
	if(typeof field2 === "undefined") {field2 = ""};
	if(typeof field3 === "undefined") {field3 = ""};
	if(typeof field4 === "undefined") {field4 = ""};

	var table = document.getElementById("badgeForm");
	var row = table.insertRow(-1);

	var name = row.insertCell(0);
	var pronoun = row.insertCell(1);
	var line1 = row.insertCell(2);
	var line2 = row.insertCell(3);

	name.innerHTML = '<input type="text" placeholder="Name" class="badgeField form-control" value="'+ field1 +'">';
	pronoun.innerHTML = `<input type="text" placeholder="Pronouns" class="badgeField form-control" list="pronounList" value="`+ field2 +`">
						<datalist id="pronounList">
							<option value="He/Him">
							<option value="She/Her">
							<option value="They/Them">
						</datalist>`;
	line1.innerHTML = '<input type="text" placeholder="Line 1" class="badgeField form-control" value="'+ field3 +'">';
	line2.innerHTML = '<input type="text" placeholder="Line 2" class="badgeField form-control" value="'+ field4 +'">';
}

function downloadPDF() {
	doc = new jsPDF(); // elemnts get added ontop of the old pdf if multiple are made without a refresh of the page.
	var table = document.getElementById("badgeForm");
	var count = table.rows.length;
	totalBadges = 0;

	//doc.addImage(largePage, 'JPEG', 0, 0, 210, 297);

	var i;
	for (i = 0; i < count; i++) {
		var row = table.rows[i];
		var name = row.cells[0].getElementsByClassName("badgeField")[0].value;
		var pronoun = row.cells[1].getElementsByClassName("badgeField")[0].value;
		var line1 = row.cells[2].getElementsByClassName("badgeField")[0].value;
		var line2 = row.cells[3].getElementsByClassName("badgeField")[0].value;

		if (totalBadges >= 8) {
			doc.addPage();
			//doc.addImage(largePage, 'JPEG', 0, 0, 210, 297);
			totalBadges = 0;
		}

		addBadge((i%2), (Math.floor((i%8)/2)), name, pronoun, line1, line2);
	}
	
	// Header info
	doc.setFontSize(16);
	var headerText = "For best results, print at actual/default size, without scaling"
	var offsetX = 15;
	var offsetY = 15;
	doc.text(offsetX, offsetY, headerText);

	doc.save('badges.pdf');

}

function addBadge(x, y, name, pronoun, line1, line2) {
	// Draw borders
	doc.setLineWidth(0.1);
	doc.setDrawColor(192, 192, 192);
	doc.rect(anchorsX[x], anchorsY[y], largeWidth, largeHeight);

	// Logo
	var logoWidth = 60;
	var logoHeight = 10;
	var offsetLogoX = (largeWidth / 2) - (logoWidth / 2);
	var offsetLogoY = 5;
	doc.addImage(logo, 'JPEG', anchorsX[x] + offsetLogoX, anchorsY[y] + offsetLogoY, logoWidth, logoHeight);

	// Text
	// offsets in millimetres
	var fontSizeName = 36;
	var fontSizePronoun = 16;
	var fontSizeLine = 16;

	// formatting for empty rows
	var emptyLineOffset = [0,0,0,0];
	if (name != "" && pronoun == "" && line1 == "" && line2 == "") {
		// name only
		emptyLineOffset[0] = 10;
	} else if (name != "" && pronoun != "" && line1 == "" && line2 == "") {
		// name and pronoun
		emptyLineOffset[0] = 5;
		emptyLineOffset[1] = 10;
	} else if ((name != "" && pronoun != "" && line1 != "" && line2 == "") || (name != "" && pronoun != "" && line1 == "" && line2 != "")) {
		// name and pronoun and either line 1 or line 2 is filled
		if (line1 == "") {
			line1 = line2;	
		} 
		line2 = "";
		emptyLineOffset[0] = 2;
		emptyLineOffset[1] = 4;
		emptyLineOffset[2] = 6;
	} else if ((name != "" && pronoun == "" && line1 != "" && line2 == "") || (name != "" && pronoun == "" && line1 == "" && line2 != "")) {
		// name and either line 1 or line 2 but no pronoun
		if (line1 == "") {
			line1 = line2;	
		} 
		line2 = "";
		emptyLineOffset[0] = 3;
		emptyLineOffset[2] = 0;
	} else if (pronoun == "") {
		// no pronoun, but may be name or line 1 or line 2
		emptyLineOffset[2] = -6;
		emptyLineOffset[3] = -6;
	}

	 // else default 4 lines
	var maxNameWidth = largeWidth - 10;
	var localFontSizeName = fontSizeName;
	var fontSizeReduction = 2;
	do {
		doc.setFontSize(localFontSizeName);
		doc.setFontType('bold');
		var boldWeight = 1.078; // number found through trial and error (1.078)
		var nameDimensions = doc.getTextDimensions(name);
		localFontSizeName -= fontSizeReduction;
	} while (boldWeight * getWidthToMM(nameDimensions.w, localFontSizeName) > maxNameWidth);
	var offsetNameX = (largeWidth / 2) - (boldWeight * (getWidthToMM(nameDimensions.w, localFontSizeName + fontSizeReduction)) / 2);
	var offsetNameY = 28;
	doc.text(anchorsX[x] + offsetNameX, anchorsY[y] + offsetNameY + emptyLineOffset[0], name);
	doc.setFontType('normal');
	
	doc.setFontSize(fontSizePronoun);
	var pronounDimensions = doc.getTextDimensions(pronoun);
	var offsetPronounX = (largeWidth / 2) - (getWidthToMM(pronounDimensions.w, fontSizePronoun) / 2);
	var offsetPronounY = 37;
	doc.text(anchorsX[x] + offsetPronounX, anchorsY[y] + offsetPronounY + emptyLineOffset[1], pronoun);

	doc.setFontSize(fontSizeLine);
	var line1Dimensions = doc.getTextDimensions(line1);
	var offsetLine1X = (largeWidth / 2) - (getWidthToMM(line1Dimensions.w, fontSizeLine) / 2);
	var offsetLine1Y = 47;
	doc.text(anchorsX[x] + offsetLine1X, anchorsY[y] + offsetLine1Y + emptyLineOffset[2], line1);
	
	var line2Dimensions = doc.getTextDimensions(line2);
	var offsetLine2X = (largeWidth / 2) - (getWidthToMM(line2Dimensions.w, fontSizeLine) / 2);
	var offsetLine2Y = 55;
	doc.text(anchorsX[x] + offsetLine2X, anchorsY[y] + offsetLine2Y + emptyLineOffset[3], line2);

	totalBadges++;
}

function getWidthToMM(width, fontSize) {
	return (width * 25.4) / 72;
}